import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

import MainNavbar from '../MainNavbar.js';
import ProductNavbar from './ProductNavbar.js';

/*Supplements*/
import BrainBoosters from './Supplements/BrainBoosters.js';
import HeartHealth from './Supplements/HeartHealth.js';
import JointHealth from './Supplements/JointHealth.js';
import LiverTonic from './Supplements/LiverTonic.js';
import NaturalAntiOxidants from './Supplements/NaturalAntiOxidants.js';
import HormonesOralContraceptives from './Supplements/HormonesOralContraceptives.js';
import SlimmingWeightMgmt from './Supplements/SlimmingWeightMgmt.js';
/*Injury*/
import BluntTrauma from './Injury/BluntTrauma.js';
import MuscleRelaxants from './Injury/MuscleRelaxants.js';
import WoundHealing from './Injury/WoundHealing.js';
/*Illness*/
import CoughCold from './Illness/CoughCold.js';
import EarNoseThroat from './Illness/EarNoseThroat.js';
import UrinaryIncontinence from './Illness/UrinaryIncontinence.js';
import Dermatological from './Dermatological/Dermatological.js';
import Disinfectants from './Disinfectants/Disinfectants.js';
import MedicalTools from './MedicalTools/MedicalTools.js';

function Product () {

    const [pageStatus, setPageStatus] = useState("BB");
    console.log("current page: " + pageStatus );

    /*This is to close the modal and reset the value*/
    function CallBack (childData) {
        console.log("product: " + childData);
        setPageStatus(childData);
    } 
    
    return (
        <>
        
            <MainNavbar activeTab="/products"/>
            <div className="container section product">
                <div className="row">
                    <div className="col-12 col-sm-4">
                        <ProductNavbar handleCallBack={CallBack} activeTab={pageStatus}/>

                    </div>


                    <div className="col-12 col-sm-8">

                        {
                            pageStatus === "BrainBoosters" ? (
                                <BrainBoosters />
                            ) : pageStatus === "HeartHealth" ? (
                                <HeartHealth />
                            ) : pageStatus === "JointHealth" ? (
                                <JointHealth />
                            ) : pageStatus === "LiverTonic" ? (
                                <LiverTonic />
                            ) : pageStatus === "NaturalAntiOxidants" ? (
                                <NaturalAntiOxidants />
                            ) : pageStatus === "HormonesOralContraceptives" ? (
                                <HormonesOralContraceptives />
                            ) : pageStatus === "SlimmingWeightMgmt" ? (
                                <SlimmingWeightMgmt />
                            ) : pageStatus === "BluntTrauma" ? (
                                <BluntTrauma />
                            ) : pageStatus === "MuscleRelaxants" ? (
                                <MuscleRelaxants />
                            ) : pageStatus === "WoundHealing" ? (
                                <WoundHealing />
                            ) : pageStatus === "CoughCold" ? (
                                <CoughCold />
                            ) : pageStatus === "EarNoseThroat" ? (
                                <EarNoseThroat />
                            ) : pageStatus === "UrinaryIncontinence" ? (
                                <UrinaryIncontinence />
                            ) : pageStatus === "Dermatological" ? (
                                <Dermatological />
                            ) : pageStatus === "Disinfectants" ? (
                                <Disinfectants />
                            ) : pageStatus === "MedicalTools" ? (
                                <MedicalTools />
                            ) : (
                                <BrainBoosters />
                            )
                        }

                    </div>
                </div>
            </div>





        </>
    );
}


export default Product;
